import React from "react";
import { Link } from "react-router-dom";
import {
  NavBarWrap,
  Links,
  DropDown,
  DropDownContents,
  Logo,
} from "./styledNav";
import NavLink from "./NavLink";

const NavBar = () => {
  let isLogin = false;

  return (
    <NavBarWrap>
      <Logo to="/">SantaIsSanta</Logo>
      <Links>
        <NavLink goto="/login" contents="테스트" />
        <DropDown>
          지역별
          <DropDownContents>
            <NavLink goto="/" className="dropdowncotents">
              수도권
            </NavLink>
            <NavLink goto="#" className="dropdowncotents">
              강원도
            </NavLink>
            <NavLink goto="#" className="dropdowncotents">
              경상도
            </NavLink>
            <NavLink goto="#" className="dropdowncotents">
              전라도
            </NavLink>
            <NavLink goto="#" className="dropdowncotents">
              충청도
            </NavLink>
            <NavLink goto="#" className="dropdowncotents">
              제주도
            </NavLink>
          </DropDownContents>
        </DropDown>
        <NavLink goto="" contents="커뮤니티" />
        {isLogin ? (
          <NavLink goto="" contents="로그인" />
        ) : (
          <NavLink goto="" contents="로그아웃" />
        )}
        <NavLink goto="" contents="마이페이지" />
      </Links>
    </NavBarWrap>
  );
};

export default NavBar;
